import React from "react";
import DarkMode from "../DarkMode";
import styled from "styled-components";
import { Link } from "react-router-dom";
import { useSelector } from "react-redux";

const AsideBar = styled.aside`
  position: relative;
  left: -480px;
`;

const Nav = styled.nav``;

const Ul = styled.ul`
  list-style: none;
  margin-top: 59px;
  display: flex;
  flex-direction: column;
  gap: 15px;
`;

const FirstUl = styled(Ul)`
  margin-top: 39px;
`;

const ListTitle = styled.p`
  font-family: Lato;
  font-weight: 700;
  font-size: 18px;
  line-height: 21.6px;
  color: ${({ theme }) =>
    theme.isDarkMode ? "rgba(249, 249, 249, 0.67)" : "black"};
`;

const Li = styled.li`
  color: ${({ theme }) => (theme.isDarkMode ? "#fff" : "black")};
  margin-top: 15px;
  display: "flex";
  gap: 15px;
`;
const StyledLink = styled(Link)`
  color: ${({ theme }) => (theme.isDarkMode ? "#fff" : "black")};
  text-decoration: none;
  font-family: Lato, sans-serif;
  font-size: 18px;
  font-weight: 600;
  line-height: 21.6px;
  text-align: left;
  display: flex;
  gap: 15px;
`;

const Image = styled.img`
  filter: ${({ theme }) => (theme.isDarkMode ? "invert(0)" : "invert(1)")};
`;

const Aside = () => {
  const isDarkMode = useSelector((state) => state.theme.isDarkMode);
  return (
    <AsideBar>
      <Nav>
        <FirstUl>
          <ListTitle>
            Menu
            <Li>
              <div>
                {isDarkMode ? "Light Mode" : "Dark Mode"}
                <DarkMode />
              </div>
            </Li>
          </ListTitle>
          <Li>
            <StyledLink></StyledLink>
            <StyledLink style={{ color: "#F8B319" }} to="/">
              <img src="/images/Squircle.png" />
              Home
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <Image src="/images/Discover.png" />
              Discover
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <Image src="/images/Award.png" />
              Awards
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <Image src="/images/Celebrities.png" />
              Celebrities
            </StyledLink>
          </Li>
        </FirstUl>
        <Ul>
          <ListTitle>Library</ListTitle>
          <Li>
            <StyledLink to="/">
              <Image src="/images/Recent.png" />
              Recent
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <Image src="/images/Top Rated.png" />
              Top Rated
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <Image src="/images/Downloaded.png" />
              Downloaded
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <Image src="/images/Playlists.png" />
              Playlists
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <Image src="/images/Watchlist.png" />
              Watchlist
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <Image src="/images/Completed.png" />
              Completed
            </StyledLink>
          </Li>
        </Ul>
        <Ul>
          <ListTitle>General</ListTitle>
          <Li>
            <StyledLink to="/">
              <Image src="/images/Settings.png" />
              Settings
            </StyledLink>
          </Li>
          <Li>
            <StyledLink to="/">
              <Image src="/images/Log Out.png" />
              Log Out
            </StyledLink>
          </Li>
        </Ul>
      </Nav>
    </AsideBar>
  );
};

export default Aside;
